#include <iostream>
#include <vector>
using namespace std;

int main() {
  string s;
  cin >> s;
  int n = s.size(), m = n * 2 - 1;
  string t(m, '#');
  for (int i = 0; i < n; i++) t[i * 2] = s[i];
  vector<int> v(m);
  for (int i = 0; i < m; i++) {
    int j = 1;
    while (0 <= i - j && i + j < m && t[i - j] == t[i + j]) j++;
    v[i] = j;
  }
  /* Efficient implementation. See the feedback comments.
  int c = 0;
  for (int i = 0; i < m; i++) {
    int l = c - (i - c);
    if (i + v[l] < c + v[c]) {
      v[i] = v[l];
    } else {
      int j = c + v[c] - i;
      while (0 <= i - j && i + j < m && t[i - j] == t[i + j]) j++;
      v[i] = j;
      c = i;
    }
  }
  */
  int decompositions = 0;
  for (int i = 0; i <= n; i++) {
    for (int j = i; j <= n; j++) {
      bool f = (i - 1) * 2 < 0 + i - 1 + v[0 + i - 1];
      bool g = (j - 1) * 2 < i + j - 1 + v[i + j - 1];
      bool h = (n - 1) * 2 < j + n - 1 + v[j + n - 1];
      if (f && g && h) decompositions++;
    }
  }
  cout << decompositions << endl;
}
